import { React, useState } from "react";

function Show(){
    
    return (
      <div className="main">
        <div className="container">
          <br />
          <h2> Added Datas!!</h2>
          <br />
          <input type='number' placeholder='age' 
            />
        <button >Show API Data</button>
        <ul>
          <li>hello!</li>
        </ul>
        </div>
      </div>
    );
}

export default Show;
